import React from "react";
import UserItem from "./UserItem/UserItem";
import axios from 'axios';

const userList = props => {

    let users = null;
    let userItems = null;
    axios
        .get('http://localhost:8088/api/user')
        .then(response => {
            users = response.data;
            userItems = users.map((user, index) => (
                <UserItem source = {props.source} name = {props.name} age = {props.age} country = {props.country}/>
            ))
        })
        .catch(error => {
            console.log(error);
        });


    return <div>userItems</div>;
};

export default userList;
